import { useEffect, useState } from "react";
import { CSSTransition } from "react-transition-group";
import styles from "./contactUs.module.css";
import PersonalCard from "./PersonalCard";
import "./styles.css";

export default function ContactUs() {
  const [fadeCard, setFadeCard] = useState(false);

  useEffect(() => {
    setFadeCard(true);
  }, []);

  console.log("로드 1");

  return (
    <div className={styles.main}>
      <CSSTransition in={fadeCard} classNames="card1" timeout={1000}>
        <PersonalCard
          name={"이우석"}
          infoText="Developer"
          infoText2="Back End."
          image="url(../../../../config/img/ProfileMin.png)"
        />
      </CSSTransition>
      <CSSTransition in={fadeCard} classNames="card2" timeout={1500}>
        <PersonalCard
          name={"민경서"}
          infoText="Developer"
          infoText2="Back End."
          styleClassName={styles.card2}
        />
      </CSSTransition>
      <CSSTransition in={fadeCard} classNames="card3" timeout={2500}>
        <PersonalCard
          name={"이광규"}
          infoText="Developer"
          infoText2="Front End."
          styleClassName={styles.card3}
        />
      </CSSTransition>
    </div>
  );
}
